    return ( <
        div class = "note"
        key = { note.id } >

        {
            /* { note.title } 
            note in h3 */
        } <
        h3 > { note.title } < /h3>  

        <
        div class = "note_bottom" >
        <
        p id = "date" > { note.date } < /p> <
        div class = "btns" >
        <
        button > < img src = { editBtnImage }
        alt = "" / > < /button> <
        button onClick = {
            () => remove(note.id) } > < img src = { removeBtnImage }
        alt = "" / > < /button> <
        /div> <
        i class = "border-bot" > < /i> <
        /div> <
        /div>
    )
}

export default Note
